import logo from './logo.svg';
import './App.css';
import Grid from '@material-ui/core/Grid';


function Bio() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Miguel Zurk Cruz
        </p>
      </header>
      <Grid item xs={12}>
        <Grid container justify="center">
          {[0, 1, 2].map((value) => (
            <Grid key={value} item>
              <p>{value}</p>
            </Grid>
          ))}
        </Grid>
      </Grid>
    </div>
  );
}

export default Bio;
